INSERT INTO `misjespis` (`id_misji`, `nazwa`, `wyswietl`, `etap`, `lokalizacja`, `mapa`, `kto`, `typ`, `czas`, `porazka`, `minpoziom`, `tresc`, `pyt`, `odp`, `pyt2`, `odp2`, `odrzuc`, `potwierdz`, `wykonaj`, `nagtresc`, `co1`, `ile1`, `co2`, `ile2`, `co3`, `ile3`, `co4`, `ile4`, `nagco1`, `nagile1`, `nagco2`, `nagile2`, `nagco3`, `nagile3`, `nagco4`, `nagile4`) VALUES
(1, 'kupieckiepotrzeby', 'Kupieckie potrzeby', 0, '631', 'mapa', 'artok', 'przynies', 0, -1, 2, 'Ile można czekać! Mosz dla mnie te surowce? ...</br> Jak to jakie!? Miołeś przynieść mi <b> 10 drewna i 10 kamienia</b>... do roboty leniu!', 'Jakie surowce!? Chyba mnie z kimś pomyliłeś grubasie!', 'Hem? No rzeczywiście... chybam Ciem pomylił z moim pachołkiem- Izkhrem.</br>Ale napoczemu od razu tak niegrzecznie? Stać mnie to żrem i tyjem - kto bogatemu zabroni?</br>Ale do surowców wracając- przynieś mi je, a odpalem Tobie ja coś z mojego kramiku obogiego... ', 'Jak Cię zwą gruby kupcze?', 'Hem? A cośty z ksionżyco spodł? Toż ja Artok jestem...</br> Najlepszy hondlorz w cołej Łutopji!', 'A idźty... Nie będę z takim gburem jak Ty rozmawiać!', 'Dobra, dobra.. zaraz przyniosę. Po co tak krzyczeć od razu?', 'Proszę, oto Twoje surowce.', 'Dobrze się spisałeś. W nagrodem dosteniesz odemie pare groszaków i jedyn z moich toworów... możem... tom koszulem!', 'drewno', 10, 'kamien', 10, '', 0, '', 0, 'miecz', 1, 'aurar', 40, '', 0, '', 0),
(2, 'kupieckiepotrzeby', 'Kupieckie potrzeby', 1, '631', 'mapa', 'artok', 'zabij', 48, -1, 2, 'Dołżeś rade z tymi patykami i kamulcami, to i szczurom dosz rade.. zobij ich z tuzin i wróć do mię potym - srogo zapłace za wybicie tych zosrońców...', 'Gdzie znajdę szczury?', 'Heh. Raczej dzie one Cie znajdo. Heh. Heh. Na drogach i polach roi się od tych paskudników...', 'brak', '', 'Nie mam teraz czasu na to...', 'Czemu nie...? Idę ich szukać!', 'Szczury zabite! Co z tą nagrodą? ', 'Cieszem siem, jak widze, że te obszydrogi piekom sie na łognisku. Dobra robota - masz tu po 15 aurar za kożdego ... czyli razym... no... ten... masz 300 aurar i nie kryńć mi sie pod nogomi!', 'szczur', 12, '', 0, '', 0, '', 0, 'aurar', 300, '', 0, '', 0, '', 0),
(3, 'kupieckiepotrzeby', 'Kupieckie potrzeby', 2, '631', 'mapa', 'artok', 'dalej', 0, -1, 2, 'O! Te! Ty! Potrza mie tu ręc jakiś do robotania! Dom Ci jo 100 aurarów, dwie łopaty i kilof (tak na wszelaki wypadek), a Ty śmignijże na pustynie do Setharów i przytargaj mie tu ze 20 worków piasku!', 'Na pustynię? Jak się tam dostanę?', 'Prosto bratku! Prosto! Bo na co krzywo jak można prosto. Heh. Heh. Idże na pomost, tam się przez rzyke przeprow, a potem na południe przez góry. Rzut kamieniem!', 'brak', 'brak', 'Może innym razem', 'brak', 'Wchodzę w to!', 'Masz tu narzyndzia! Płyń i szybko wrocoj!', '', 0, '', 0, '', 0, '', 0, 'aurar', 100, 'lopata', 2, 'kilof', 1, '', 0),
(4, 'kupieckiepotrzeby', 'Kupieckie potrzeby', 3, '631', 'mapa', 'artok', 'przynies', 0, -1, 2, 'No i dzie tyn piosek? ', 'Przypomnij mi proszę - skąd wezme ten piasek?', 'Hem. Gupi Ty jakiś, cyco? Przecier żym mówił Tobie. Piasek z pustyni wyźmiesz łopatom. Wyjdźże z miosta drogom prostom i dojdziesz do przystani - tam płyń do miasta Setharów, albo przepłyń przez rzykę i idź na południe - do gór - przejdź przez góry i byndziesz miał piosku jak... ee... no piosku...', 'ile miało być tego piasku?', 'Dwa razy tyle, co moich grubych palców u ręk. Heh. Heh.', 'Przyniose go później...', 'Już płynę!', 'Oto Twój piasek', 'No. Dobra robota.\r\nMosz tu w nagrodę gornek toki...', 'piasek', 20, '', 0, '', 0, '', 0, 'helmgarnkowy', 1, '', 0, '', 0, '', 0),
(7, 'deficyt', 'Deficyt budżetowy', 0, '631', 'mapa', 'dzika', 'przynies', 0, -1, 3, 'No więc sprawy mają się tak, że nasz skromny Centralny Bank Północny [CBP] dał za wiele zbyt ryzykownych pożyczek w walucie, której wartość zbyt szybko rosła, a w zastaw wzięliśmy towary, których wartość regularnie spadała. ot, taki mały problem. W każdym razie - potrzeba nam jakieś 5000 aurar. Jeśli uda Ci się zdobyć dla nas te pieniądze, weźmiemy Cię do siebie na nauki i z pewnością zyskasz na tym wiele! Co Ty na to? ', 'Muszę wszystko przynieść na raz?', 'Tak ... Tak będzie lepiej...', 'Co da mi Wasze szkolenie?', 'Och... myślę, że zdecydowanie wspomoże ono Twój rozwój!', 'Źle gospodarowaliście pieniędzmi, to macie teraz problem... mnie w to nie mieszaj..', 'Zobaczymy - może uda mi się zdobyć dla Was te pieniądze.', '5000 aurar. Nawet nie wiecie ile mnie to kosztowało wysiłku... A teraz - uczcie ', 'Z nieba nam spadasz! \r\nNauczymy Cię wszystkiego co sami umiemy!\r\n<br>[otrzymujesz 2 punkty rozwoju]', 'aurar', 5000, '', 0, '', 0, '', 0, 'rozwoj', 2, '', 0, '', 0, '', 0),
(8, 'deficyt', 'Ogromny deficyt budżetowy', 1, 'polnocnybank', '', 'deficyt', 'przynies', 0, -1, 10, 'Wiesz jak to jest... długo Cię nie było, kasy było mało, kredyty niepospłacane, musieliśmy się sami zadłużyć, żeby mieć złota na podstawowe operacje finansowe i ośmiorniczki... i okazuje się, że dług nam rośnie, zamiast maleć - taki ... eee... klops. \n</br> W każdym razie - dobrze Ci ostatnio poszło - ale może tym razem byś chciał trochę bardziej nam pomóc? Przynieś nam jeszcze 20.000 aurar, a nauczymy Cię dwa razy więcej niż poprzednio! ', 'Kto Was uczył ekonomii bydlaki?', 'Ekoczego? ', 'Już nie pamiętam ile ostatnio mnie nauczyliście, więc powiedzcie normalnie - co dostanę w zamian?', 'Wiedzę! Dużo wiedzy, która wspomoże Twój rozwój! [4pkt. rozwoju]', 'Głupi jesteście - wydajecie więcej, niż zarabiacie, to takie są tego efekty... ', 'Nie zadłużajcie się dalej... postaram się znaleźć dla Was te pieniądze...', 'Ostatni raz ratuję Wam tyłki - oto 20.000 aurar...', 'Oczywiście! To ostatni raz! Od dziś z pewnością będziemy mądrzej zajmować się tymi pieniędzmi!</br> [otrzymujesz 4 punkty rozwoju]', 'aurar', 20000, '', 0, '', 0, '', 0, 'rozwoj', 4, '', 0, '', 0, '', 0),
(9, 'nimfa', 'Leśna Nimfa', 0, 'lesnypalac', '', 'nimfa', 'dalej', 0, -1, 5, 'Witaj przystojniaku!\r\nWpadnij do mnie - mam coś ciekawego dla Ciebie!', 'Eeee? Ale co?', 'Mmm... zobaczysz!', 'brak', 'brak', 'Phi! nie skusisz mnie!', 'brak', 'Z przyjemnością! [idę]', '[Nimfa pobiegła w stronę pałacu delikatnie stąpając po ziemi bosymi stopami. Kiedy wbiegłeś za nią do środka na ziemi leżał tylko liścik (dosłownie, bo napisany na dużym, twardym liściu) "znajdziesz mnie u zielarza"] \r\n', '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(10, 'nimfa', 'Leśna Nimfa', 1, 'zielarz', '', 'nimfa', 'zabij', 48, -1, 5, 'Ciesze się, że przyszedłeś mi pomóc! \r\nPosłuchaj - jest tu niedaleko taka polana, na której lubię pląsać o poranku, w deszczu, albo w czasie pełni, albo ... no po prostu lubię...\r\nAle od jakiegoś czasu w lesie pojawił się stary zbok Pafnucy. \r\nPrzeszukaj las. Zajmij się tym. Zrób coś. Nie wiem. Cokolwiek.', 'Chcesz żebym go zabił tylko dlatego, że gapił się na Ciebie?', 'Nie wiem. Zajmij się tym, a dostaniesz ode mnie odpowiednią nagrodę...', 'Gdzie dokładnie go znajdę?', 'Krąży po lasach i podgląda dziewki. Nie wiem gdzie jest teraz. Mam nadzieję że daleko!', 'Jak goła latasz, to nie dziw się, że się gapią!', 'Dobrze. Zajmę się starym zbokiem.', 'Pafnucy już nie będzie Ci przeszkadzał.', 'Och... Aleś Ty dzielny!\nMam dla Ciebie prezent - dziś moja babka ugotowała - trochę cudów nowoczesnego zielarstwa!\nA! Jakbyś gdybyś mnie szukał, to będę gdzieś w osadzie!\n[otrzymałeś 5 naparów i 10 mieszanek ziołowych]\n', 'zbokpafnucy', 1, '', 0, '', 0, '', 0, 'naparziolowy', 5, 'ziolowamieszanka', 10, '', 0, '', 0),
(11, 'czerwonobrody', 'Zło-To Czerwonobrodego', 0, 'bank', '', 'czerwonobrody', 'dalej', 0, -1, 4, 'Ekhem... Witam w <b>MOIM</b> banku.\nCo Cię tu sprowadza?\nMoże szukasz okazji do zarobku?', 'Może tak, ale najpierw powiedz kim jesteś.', 'Ekhem... Jestem Czerwonobrody. <b>NAJBOGATSZY CZŁOWIEK W CAŁEJ OSADZIE BRODACZY</b>. Ekhem... Powtórzyć? Głośniej?', 'Czy to jedyny bank? Jeśli zostawię tu pieniądze, to tylko tu będę mógł później je podjąć? ', 'Ekhem... To <b>JEDYNY i NAJLEPSZY BANK W TEJ OSADZIE!</b> Ekem... Na północy - w mieście Agerów jest drugi. Gorszy. Brzydszy. Biedniejszy...</br> Ale: tak - będziesz mógł tam odebrać zdeponowane tu złoto.', 'Nie, dziękuję. Przyszedłem tylko skorzystać z usług banku.', 'brak', 'Złoto zawsze się przyda!', 'Ekhem... No to chodź tu do mojej komnaty... <b>NAJBOGATSZY CZŁOWIEK TEGO MIASTA NIE BĘDZIE ROBIĆ INTERESÓW WŚRÓD PLEBSU!</b>', '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(12, 'yoda', 'Niesamowity Wszechświat jest', 0, '730', 'mapa', 'yoda', 'przynies', 24, -1, 1, 'Widzieć rad Cię jestem. Mmmm... Wieści o czynach Twoich jak Twój zapach. \nNa długo przed Tobą do mnie dotarły. \nCzasu na uprzejmości jednak marnować nam nie wolno.\nDziałać musisz, by zadanie swe wykonać.\nUtknęło w bagnie coś cennego, ale później o tym. Mmmm...\nCo to ja tam mówiłem... eee... znaczy... skupić się trzeba, zanim rzeknie się coś.\nDo sedna przechodząc jednak - plecy moje jak u starca wygięte, a potrzeby jak u młodzika... Dziesięć skrętów mi przynieś. Ale już!', 'Skrętów? Takich do palenia? ', 'Zaiste cudowny umysł dziecka jest... Mmm... Do palenia dziecko, do palenia. U Zielarza zrobić je możesz.', 'Co dostanę w zamian?', 'Mmmm... Przywiązanie prowadzi do zazdrości. Cieniem chciwości jest ono. Pozbywać się wszystkiego ucz się, co boisz stracić się. ', 'Zawsze byłem ciekaw jak się suszy te włosy z uszu... Bywaj!', 'To nie może być trudne - przyniosę!', 'Oto Twoje skręty ... ee... Mistrzu?', 'Mmm... Mój młody Padawanie... uczyć się czas najwyższy. Zasada palenia.. najważniejsza! "Dwóch zawsze ich jest. Nie mniej, nie więcej."\nMmm... Ze mną usiądź i odpręż się... \n[Zielony stworek podaje Ci skręta... ]Hmm... Nagroda. Tak... [uzyskujesz 200 doświadczenia!]', 'skret', 10, '', 0, '', 0, '', 0, 'exp', 200, '', 0, '', 0, '', 0),
(13, 'zarobek', 'Częste mycie...', 0, 'bank', '', 'czerwonobrody', 'przynies', 0, -1, 2, 'Słuchaj - mam dziś wieczorem ważne spotkanie - wiesz, w INTERESACH [puszcza oko]. JESTEM NAJBOGATSZYM CZŁOWIEKIEM W TYM MIEŚCIE i nie mogę capić jak ten przykurcz z bagien. Przynieś mi 10 szt. wody.', 'skąd wezmę wodę?', 'Napełnij jakieś naczynie [np. bukłak, beczka, butelka...] w studni - tuż obok', 'brak', 'brak', 'Nie mam teraz czasu. Ale kąpiel rzeczywiście by Ci się przydała', 'Zaraz wracam z wodą!', 'Oto woda [chlust] ', 'Dobra robota. Masz tu sakiewkę, nie mam czasu liczyć ...\r\n[zarobiłeś 200 aurar i 20 doświadczenia]', 'woda', 10, '', 0, '', 0, '', 0, 'exp', 20, 'aurar', 200, '', 0, '', 0),
(14, 'rzez', 'Bóg Mordu', 0, 'warownia', '', 'watz', 'zabij', 48, -1, 5, 'Witaj. Jestem Watz - jedyny bezbrody w administracji Jarla. Zapamiętaj sobie na przyszłość - im dłuższą ktoś ma brodę, tym mniej robi w tej osadzie...\r\nAle przejdźmy do rzeczy - chciałbym Ci zlecić małą rzeź: przejdź się po drogach i lasach i zabij 10 bandytów. \r\nDam Ci 30 aurar od głowy.', 'ile mam czasu na wykonanie tego zadania?', 'Od momentu w którym je przyjmiesz masz 48 godzin - później zadanie będziesz musiał brać od nowa. To dotyczy wszystkich tego typu zadań.', 'brak', 'brak', 'Nie jestem jeszcze gotowy.', 'Skoro prosisz o rzeź, to zorganizuję rzeź - zaraz wrócę z głowami bandytów', '[rzucam worek z głowami bandytów pod nowi Watza]', 'Oto zapłata [zarobiłeś 300 aurar].\r\nJeśli będziesz potrzebował dobrze płatnych zleceń to szukaj mnie gdzieś w osadzie - przetargi na takie rzezie  zawsze ustawiam osobiście...', 'bandyta', 10, '', 0, '', 0, '', 0, 'aurar', 300, '', 0, '', 0, '', 0),
(15, 'gyana', 'Wiadro pełne w połowie', 0, '623', 'mapa', 'gyana', 'dalej', 0, -1, 2, 'Hej! Pomożesz mi z tym wiadrem? \r\n</br>[dziewczyna siłuje się z korbą od studni]', 'Kto taką dziewczynę wysyła samą po wodę?! ', 'Mój pan ojciec - hutnik Vitr... W hucie wody potrzeba bez przerwy...', 'brak', 'brak', 'Nie mam teraz czasu.', 'brak', 'Jasne [wciągam wiadro]', 'Dziękuję!</br>[uzyskujesz 5 doświadczenia]', '', 0, '', 0, '', 0, '', 0, 'exp', 5, '', 0, '', 0, '', 0),
(16, 'gyana', 'Wiader dziesięć', 1, '623', 'mapa', 'gyana', 'dalej', 0, -1, 2, 'A skoro już tu jesteś... Może pomożesz mi zanieść tę wodę do huty?', 'Daleko ta huta?', 'Tuż za miastem - tylko pare kroków', 'brak', 'brak', 'Mam chore plecy - niestety nie mogę Ci pomóc...', 'brak', 'Prowadź! [łapię po dwa wiadra w każdą rękę]', 'Świetnie - chodź ze mną do huty - będziemy musieli wyjść z miasta i przejść pare kroków drogą...\n</br>[otrzymałeś 10 wody]', '', 0, '', 0, '', 0, '', 0, 'woda', 10, '', 0, '', 0, '', 0),
(17, 'gyana', 'Wiader dziesięć', 2, 'hutnik', '', 'gyana', 'przynies', 0, -1, 2, 'Wiadra postaw tam, przy piecu [pokazuje palcem na wielki, rozgrzany piec]', 'brak', 'brak', 'brak', 'brak', 'Gdzieś mi się zapodziała ta woda...', 'brak', '[stawiam wiadra przy piecu]', 'To bardzo miłe, że pomogłeś mi z tą wodą...\n</br> Wpadnij do nas kiedyś - jeśli mój pan ojciec Cię polubi to dostaniesz od niego raz na jakiś czas jakieś zlecenie\n</br>[uzyskujesz 20 doświadczenia]', 'woda', 10, '', 0, '', 0, '', 0, 'exp', 20, '', 0, '', 0, '', 0),
(18, 'wojownik', 'wojownikiem być', 1, 'morskatwierdza', '', 'wojownik', 'zabij', 24, 0, 6, 'Więc twierdzisz, że chcesz zostać wojownikiem?</br>\r\nHa! Szybko się przekonamy, czy masz jakiekolwiek szanse...\r\nMasz dobę, żeby przynieść mi głowy <b>trzydziestu bandytów</b>.\r\n', 'Głowy? Znaczy się, mam ich po prostu zabić, tak?', 'Bystryś!', 'brak', 'brak', 'Jeszcze nie jestem gotowy.', 'Poczekaj chwilę - zaraz Ci je przyniosę!', 'Bandyci zabici!', 'Dobra robota. To teraz czas na kolejne zadanie...', 'bandyta', 30, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(19, 'wojownik', 'wojownikiem być', 11, 'morskatwierdza', '', 'wojownik', 'zabij', 24, 0, 6, 'Więc twierdzisz, że chcesz zostać wojownikiem?</br>\r\nHa! Szybko się przekonamy, czy masz jakiekolwiek szanse...\r\nMasz dobę, żeby przynieść mi głowy <b>trzydziestu bandytów</b>.\r\n', 'Głowy? Znaczy się, mam ich po prostu zabić, tak?', 'Bystryś!', 'brak', 'brak', 'Jeszcze nie jestem gotowy.', 'Poczekaj chwilę - zaraz Ci je przyniosę!', 'Bandyci zabici!', 'Dobra robota. To teraz czas na kolejne zadanie...', 'bandyta', 30, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(20, 'wojownik', 'wojownikiem być', 21, 'morskatwierdza', '', 'wojownik', 'zabij', 24, 0, 6, 'Więc twierdzisz, że chcesz zostać wojownikiem?</br>\nHa! Szybko się przekonamy, czy masz jakiekolwiek szanse...\nMasz dobę, żeby przynieść mi głowy <b>trzydziestu goblinów </b>.\n', 'Głowy? Znaczy się, mam ich po prostu zabić, tak?', 'Bystryś!', 'brak', 'brak', 'Jeszcze nie jestem gotowy.', 'Poczekaj chwilę - zaraz Ci je przyniosę!', 'Gobliny zabite!', 'Dobra robota. To teraz czas na kolejne zadanie...', 'goblin', 30, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(21, 'wojownik', 'wojownikiem być', 31, 'morskatwierdza', '', 'wojownik', 'zabij', 24, 0, 6, 'Więc twierdzisz, że chcesz zostać wojownikiem?</br>\nHa! Szybko się przekonamy, czy masz jakiekolwiek szanse...\nMasz dobę, żeby przynieść mi głowy <b>trzydziestu goblinów</b>.\n', 'Głowy? Znaczy się, mam ich po prostu zabić, tak?', 'Bystryś!', 'brak', 'brak', 'Jeszcze nie jestem gotowy.', 'Poczekaj chwilę - zaraz Ci je przyniosę!', 'Gobliny zabite!', 'Dobra robota. To teraz czas na kolejne zadanie...', 'goblin', 30, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0, '', 0),
(22, 'wojownik', 'zaopatrzenie', 2, 'morskatwierdza', '', 'wojownik', 'przynies', 1, -1, 6, 'No dobrze... to było w sumie dość proste zadanie niewymagające od Ciebie dużego zaangażowania.\r\nTym razem będziesz musiał pomóc nam zaopatrzyć zbrojownie.</br>\r\nPostaraj się trochę bardziej i przynieś nam <b>10 tarcz drewnianych i 3 miecze</b>. \r\n</br> na wykonanie tej misji masz turę od momentu jej przyjęcia.\r\n', 'brak', 'brak', 'brak', 'brak', 'Przyjde może trochę później...', 'Jasne - biorę tę misję!', ' Oto zaoptrzenie!', 'No, no... rzeczywiście Ci zależy. To dobre uzbrojenie, więc masz tu 300 aurar, żebyś nie mówił potem, że Cię wykorzystujemy.\r\nJeśli się nie rozmyśliłeś i nadal chcesz być wojownikiem przyjdź po kolejną misję!', 'tarczadrewniana', 10, 'miecz', 3, '', 0, '', 0, 'aurar', 300, '', 0, '', 0, '', 0),
